import React from 'react';
import ClassCard from '../components/ClassCard';
import QuizCard from '../components/QuizCard';

function HomePage() {
  const classes = [
    { title: '3 - 1 PS Audi Java' },
    { title: '2 - 1 PS SDC' },
    { title: '2 - 1 PS Audi Java' }
  ];

  const quizzes = [
    { title: 'Classes', subject: 'Python', date: '12-10-2024' },
    { title: 'Design and Analysis of Algorithms', subject: 'Java', date: '21-09-2024' },
    { title: 'Data Structures', subject: 'C++', date: '15-09-2024' }
  ];

  return (
    <div>
      <div className="card-container">
        <h2>Classes:</h2>
        {classes.map((classInfo, index) => (
          <ClassCard key={index} title={classInfo.title} />
        ))}
      </div>

      <div className="card-container">
        <h2>Past Quizzes:</h2>
        {quizzes.map((quiz, index) => (
          <QuizCard key={index} title={quiz.title} subject={quiz.subject} date={quiz.date} />
        ))}
      </div>
    </div>
  );
}

export default HomePage;
